        <div className = "rounded d-inline-block bg-white sticky-top" style = {{width: "50%"}} >
          <h1>About Me</h1>
          <hr></hr>
        </div>
      </div>  */}

      <div className = "bg-white">
        <div className = "container">
          <div className = "row">
            <div className = "mr-4">
              <div className = "bg-white d-inline-block" >
                <Photo/>
              </div>
            </div>

            <div className = "col-sm bg-dark rounded m-4">
              <Aboutme/>
            </div>  
          </div>
        </div>
      </div>

    </>


  );
}

export default App;

